	{
		string[] memory _SearchedStoreBid = new string[](10);

		uint256 _TokenBidSearchIds2 = 0;

		for (uint256 i = 0; i < _TokenBidIds; i++) {
			if (
				keccak256(bytes(AllTokensBids[i][0])) ==
